import React from "react";
import { Link } from "react-router-dom";
export default function Home() {

	return (

		<div>
			<div className="div-right"
			>
			<ul>
				<li>
					<Link to="/about-us">
						<img src="about-us.jpeg"  width={500} height={300}  alt="" />
					</Link>
				</li>
			</ul>
			</div>

			<div>
				<h1>What is Ousia?</h1>
				<p>Ousia is a NFTs composed of 10,000 unique human-shaped machines. It has the external human body to see the internal mechanical mechanism through perspective, and implants 16 independent personalities at the same time. Ousia is determined to create a web3.0 security art brand, we will Break the stereotype of traditional network security.</p>
			</div>
		</div>


	);
}
